{if(window===window.top){window.location.href="index.htm"}window.addEventListener("message",function(e){const{data:{command:t,data:{lang:n,title:a,css:i,html:s}}}=e;switch(t){case"build":updateReport(n,a,i,s);break;case"changeCss":styleElement.innerHTML=i;break;case"changeLang":changeLang(n);break;case"print":window.print();break;default:break}});const styleElement=document.getElementById("style");const reportElement=document.getElementById("report_wrapper");const titleElement=document.getElementsByTagName("title")[0];const htmlElement=document.getElementsByTagName("html")[0];const updateReport=(e,t,n,a)=>{htmlElement.setAttribute("data-lang",e);titleElement.i18n=t;titleElement.innerHTML=t[e];styleElement.innerHTML=n;reportElement.innerHTML=a};const changeLang=e=>{htmlElement.setAttribute("data-lang",e);const t=titleElement.i18n;if(typeof t!=="undefined"){titleElement.innerHTML=t[e]}}}